  constructor(props) {
    super();
    this.state = {
      showUploadPopup: false,
      uploadCalledForLeadId: null
    }
  }

  componentWillMount() {
    DataSource.metaInit();
  }

  render() {
    return (
      <div>
        <Popup />
        <Home />
        <About />
        <Content page={this.props.page} />
      </div>
    );
  }

}
